    .then((value) => {
      const result = [];
      value.forEach((element) => {
        if (element.status === 'fulfulied') {
          result.push({ status: element.status, value: element.value });
        } else {
          result.push({ staus: element.status, value: `${element.reason}` });
        }
      });
      return result;
    });
}
